import React, { Component } from 'react';
import { Menu, MenuItem, MenuDivider } from '@blueprintjs/core';
import UIManager from '../../Modules/UIManager/UIManager';

export default class RightMenu extends Component {
   render() {
      return (
         <Menu>
            <MenuItem icon='user' text='Profile' />
            <MenuItem icon='cog' text='Settings...'></MenuItem>
            <MenuItem icon='zoom-to-fit' text='fullscreen' />
            <MenuItem
               icon={UIManager.isDarkThemeEnabled() ? 'flash' : 'moon'}
               text='Switch theme...'
               onClick={this.switchTheme}
            />
            <MenuDivider />
            <MenuItem icon='log-out' text='Logout...'></MenuItem>
         </Menu>
      );
   }
}
